import React, { Component } from 'react';
import axios from 'axios'

class ContactInformation extends Component {
    constructor() {
        super()
        this.state = {

        }
    }

    onChange(e) {

    }

    componentDidMount() {
        axios.get("http://localhost:8080/getStates").then(response => {
            const temp = response.data.map(st => {
                return <option key={st}>{st}</option>
            })

            this.setState({
                states: temp
            })
        })
    }

    render() {
        return (
            <div>
                <form>
                    <div class="form-group">
                        <label for="inputAddress">Address</label>
                        <input type="text" onChange={e => this.onChange} name="address" class="form-control" id="inputAddress" placeholder="1234 Main St" />
                    </div>
                    <div class="form-group">
                        <label for="inputAddress2">Address 2</label>
                        <input type="text" onChange={e => this.onChange} name="unit" class="form-control" id="inputAddress2" placeholder="Apartment, studio, or floor" />
                    </div>
                    <div class="form-row">
                        <div class="form-group col-md-6">
                            <label for="inputCity">City</label>
                            <input type="text" onChange={e => this.onChange} name="city" class="form-control" id="inputCity" />
                        </div>
                        <div class="form-group col-md-4">
                            <label for="inputState">State</label>
                            <select id="inputState" onChange={e => this.onChange} name="state" class="form-control">
                                <option selected>Choose...</option>
                                <option>...</option>
                            </select>
                        </div>
                        <div class="form-group col-md-2">
                            <label for="inputZip">Zip</label>
                            <input type="text" onChange={e => this.onChange} name="zipcode" class="form-control" id="inputZip" />
                        </div>
                    </div>
                    <div class="form-row">
                        <div className="col">
                        <button type="button" class="btn btn-secondary">Edit/Add Phone Number(s)</button>
                        </div>
                        <div className="col">

                        </div>
                        <button type="submit" class="btn btn-primary">Sign in</button>
                    </div>
                </form>

            </div>
        );
    }
}

export default ContactInformation;
